  /// CONVERT STRING AUDIO TO BINARY BUFFER
  function base64ToBuffer(buffer) {
      var binary = window.atob(buffer);
      var buffer = new ArrayBuffer(binary.length);
      var bytes = new Uint8Array(buffer);
      for (var i = 0; i < buffer.byteLength; i++) { bytes[i] = binary.charCodeAt(i) & 0xFF; }
      return buffer;
  }
  /// PLAY A BUFFER
  function playBuffer(buffer) {
    if ( localStorage.audio == "on" ) {
      var binaryAudio = base64ToBuffer(buffer);
      cachedAudioContext.decodeAudioData(binaryAudio, function (buffer) {
        var source = cachedAudioContext.createBufferSource();
        source.buffer = buffer;
        source.loop = false;
        source.connect(cachedAudioContext.destination);
        source.start(0); // Play immediately.
      }, function (e) {
        console.log('Error decoding file', e);
      });
    }
  }

